const { BrowserRouter, Routes, Route } = require ("react-router-dom");

function AppRoutes () {
    return(
        <BrowserRouter>
            <Routes>
                <Route
                    path="/"
                    element={<Inicio/>}>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}

export default AppRoutes;
